      body {
        font-size: 1rem;
        line-height: 1.5;
        -webkit-font-smoothing: antialiased;
        text-rendering: optimizeLegibility;
        -webkit-text-size-adjust: 100%;
        zoom: 1;
        font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto,
          Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji",
          "Segoe UI Symbol";
      }
  
      header p strong {
        text-transform: uppercase;
      }

      .post-title {
        text-align: center;
        margin: 10rem 0;
        color: white;
        padding: 2rem;
        font-weight: bold;
      }

      a,
      a:visited {
        font-weight: bold;
      }

      a:hover,
      a:visited:hover {
        color: dodgerblue;
      }

      a.active {
        padding: 0.5rem;
        color: white;
        font-weight: bold;
      }

      blockquote {
        background: #f9f9f9;
        font-size: 120%;
        margin: 2rem 0;
        padding: 1rem;
      }

      blockquote p {
        margin: 0;
      }

      blockquote footer {
        font-size: 90%;
        margin: 1rem 0 0 0;
      }

      dl dt {
        margin-bottom: 0.5rem;
      }

      dl dd {
        font-style: italic;
        margin-bottom: 2rem;
      }

      code,
      pre {
        font-family: San Francisco Mono, Monaco, "Consolas", "Lucida Console",
          "DejaVu Sans Mono", "Bitstream Vera Sans Mono", monospace;
        font-size: 92%;
      }

      pre {
        color: white;
        overflow: auto;
        padding: 1em;
        width: 100%;
      }

      .date {
        opacity: 0.6;
      }

      html {
        box-sizing: border-box;
      }

      *,
      *:before,
      *:after {
        box-sizing: inherit;
      }

      body {
        margin: 0 auto;
        max-width: 50rem;
        padding: 1rem;
      }

      strong,
      b,
      h1,
      h2,
      h3,
      h4 {
        font-weight: bold;
